import React from 'react';

import Image from './Image.js';

function Card(props){
    return(
        <article class="Card">
            <Image 
                source = {require("./images/skyfall.jpg")}
                />
            <h1>{props.title}</h1>
             <p>{props.channelName}</p>
            <p> {props.views}</p>
        </article>
    )
}

export default Card;
